import { IconButton } from '@material-ui/core'
import { DeleteOutlined } from '@material-ui/icons'
const Cards = ({ note }) => {
    return (
        <div>   
            <Card>

                <CardHeader
                    action={
                        <IconButton>
                            <DeleteOutlined></DeleteOutlined>
                        </IconButton>
                    }
                    title={note.title}
                    subheader={note.category}
                />
                car
            </Card>

        </div>
    )
}

export default Cards
